import { Link } from "react-router-dom";

const MoviesList = ({ movies }) => {
  return (
    <div className="movies-list">
      <h2>Hello World</h2>
      {movies.map((movie) => (
        <Link to={`/movies/${movies.id}`} key={movie.id}>
          <div className="movie-card"></div>
        </Link>
      ))}
    </div>
  );
};

export default MoviesList;
